import React, { forwardRef } from 'react';

import google from '../resources/googleplay.png'
import sudoku from '../resources/sudokuExample.png'

function Card({ title, description, showBadge, imgSrc, showExample }) {
    return <div className='Card'>
        <img src={imgSrc} alt='App logo' id='deadlift'></img>
        <div className='right'>
            <h3>{title}</h3>
            <p>
                {description}
            </p>
            {showBadge && <a href='https://play.google.com/store/apps/details?id=com.fitnessapp.deadlift'><img src={google} alt='App logo' id='google'></img></a>}
            {
                showExample &&
                <img src={sudoku} alt='Sudoku example' id='example'></img>
            }
        </div>
    </div>
}


export default Card;
